import { Grid , Container} from '@mui/material';
import React from 'react';
import seven from './atoms/images/7.png';
import eight from './atoms/images/8.png';
import nine from './atoms/images/9.png';
import MyCard from './molecules/MyCard';
interface Props{

}
const NewlyAdded=(props:Props) =>{
    return (
       <>
       <Container>
           <Grid container rowSpacing={2} spacing={4}>
           <Grid item xs={12} sm={6} md={4}>
        <MyCard  button='add' progressBar='none' src={seven} name="The Lonely Century" author="Noreena Hertz" duration="15"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <MyCard  button='add' progressBar='none' src={eight} name="Eat Better, Feel Better" author="Giada De Laurentiis" duration="13" noOfReads="1.9"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <MyCard  button='add' progressBar='none' src={nine} name="Dropshipping" author="James Moore" duration="12"/>
        </Grid>
</Grid>
        </Container>
       </>
    );
}

export default NewlyAdded;
